(542, 452, 'VW0004', 'Zenobia (c. 240 – c. 274) was a third-century queen of the Syrian-based Palmyrene Empire. Her husband Odaenathus became king in 260, and elevated Palmyra to supreme power in the Near East by defeating the Sassanians and stabilizing the Roman East. After his assassination, she became the regent of her son Vaballathus and held de facto power throughout his reign. In 270, Zenobia launched an invasion which brought most of the Roman East under her sway, culminating with the annexation of Egypt. In reaction to Roman emperor Aurelian''s campaign in 272, Zenobia declared Palmyra''s secession from Rome, naming her son emperor and assuming the title of empress. The Romans were victorious after heavy fighting; the queen was besieged in her capital and captured by Aurelian. He exiled her to Rome, where she spent the remainder of her life. Zenobia fostered a multicultural and intellectual environment in her court, which was open to scholars and philosophers. Many tales have been recorded about her fate. Her rise and fall have inspired historians, artists and novelists, and she is a national hero in Syria.', 'Zenobia (c. 240 – c. 274) was a third-century queen of the Syrian-based Palmyrene Empire. Her husband Odaenathus became king in 260, and elevated Palmyra to supreme power in the Near East by defeating the Sassanians and stabilizing the Roman East. After his assassination, she became the regent of her son Vaballathus and held de facto power throughout his reign. In 270, Zenobia launched an invasion which brought most of the Roman East under her sway, culminating with the annexation of Egypt. In reaction to Roman emperor Aurelian''s campaign in 272, Zenobia declared Palmyra''s secession from Rome, naming her son emperor and assuming the title of empress. The Romans were victorious after heavy fighting; the queen was besieged in her capital and captured by Aurelian. He exiled her to Rome, where she spent the remainder of her life. Zenobia fostered a multicultural and intellectual environment in her court, which was open to scholars and philosophers. Many tales have been recorded about her fate. Her rise and fall have inspired historians, artists and novelists, and she is a national hero in Syria.', 'Zenobia (c. 240 – c. 274) was a third-century queen of the Syrian-based Palmyrene Empire. Her husband Odaenathus became king in 260, and elevated Palmyra to supreme power in the Near East by defeating the Sassanians and stabilizing the Roman East. After his assassination, she became the regent of her son Vaballathus and held de facto power throughout his reign. In 270, Zenobia launched an invasion which brought most of the Roman East under her sway, culminating with the annexation of Egypt. In reaction to Roman emperor Aurelian''s campaign in 272, Zenobia declared Palmyra''s secession from Rome, naming her son emperor and assuming the title of empress. The Romans were victorious after heavy fighting; the queen was besieged in her capital and captured by Aurelian. He exiled her to Rome, where she spent the remainder of her life. Zenobia fostered a multicultural and intellectual environment in her court, which was open to scholars and philosophers. Many tales have been recorded about her fate. Her rise and fall have inspired historians, artists and novelists, and she is a national hero in Syria.', 1, '', '', '', '', 27, 5, 1, '456123', 0, 1, 11, 11, '2017-05-23 05:45:32', '2017-05-23 05:45:32'),
